import React from "react";
import Navigation from "./Navigation";

function Hero(props) {
  return (
    <section className="Hero">
      <Navigation />
      <div className="outer">
        <div className="title">
          <div className="title-container">
            <h5>Welcome</h5>
            <h1>Heavenly Desserts</h1>
          </div>
          <div className="contact-info">
            <div className="booking">Book Table Directly</div>
            <h2 className="">617-867-5309</h2>
            <div className="hours">
              Opening Hours <strong>Mon-Fri: </strong>9am - 9pm
              <strong> Weekend</strong> 10am-10pm
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Hero;
